let user = require("../../registration/registration");

const RegistrationWithInput = ({registrationWithInputFeild,...props}) => {
  return (
    <div>
      <div>
        {Object.keys(registrationWithInputFeild).map(value => {
          return (
            <div>
              <lable>{registrationWithInputFeild?.[value]?.msg}</lable>
              <input
                type={registrationWithInputFeild?.[value]?.inputType}
              />
            </div>
          );
        })}
      </div>
    </div>
  );
};

export default RegistrationWithInput;
